transforms.result:
.modal-overlay {
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background-color: rgba(0, 0, 0, 0.5);
  display: flex;
  align-items: center;
  justify-content: center;
  z-index: 1000;
}

.success-modal {
  background-color: white;
  padding: 30px;
  border-radius: 10px;
  width: 90%;
  max-width: 400px;
  position: relative;
  text-align: center;
}

.close-button {
  position: absolute;
  top: 15px;
  right: 15px;
  background: none;
  border: none;
  font-size: 1.5rem;
  color: #666;
  cursor: pointer;
}

.success-content {
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 15px;
}

.success-icon {
  font-size: 4rem;
  color: #2c2f11;
}

.success-content h2 {
  font-family: "Roboto", sans-serif;
  font-size: 1.5rem;
  color: #2c2f11;
  margin: 0;
}

.success-content p {
  font-family: "Roboto", sans-serif;
  font-size: 1.1rem;
  color: #666;
  margin: 0;
  line-height: 1.5;
}
